script: |
  super -f text -I q10494.spq | sort > q10494.out

inputs:
  - name: q10494.spq
    data: |
      SELECT + col2 - + + col1 AS col1, + col1 * col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN + col1 * + - col2 AND col0;
  - name: tab2

outputs:
  - name: q10494.out
    data: |
